 Yeah, I need to watch the bitch closer, she tries to get out sometimes. That would be my inner bitch. 

 I did a recording last night with HackyBox, and heard the word &quot;huricane&quot;. I&#39;m seeing the same &quot;signs&quot; as before Katrina, but bigger. Big circles in the clouds, and &quot;eyes&quot;. The eyes are like the eye sockets of a skull face. So far this spring, every &quot;eye&quot; sighting has been before a tornado out east. 

 Another face in the shower, a guy with big hair, almost dreadlocks, a large thick mustache, very pronounced brow ridge, and eye sockets, long chin. He was in the window, and for the first time, the shower curtain. 

 Frank-S


